toastr.options = {
    closeButton: true,
    progressBar: true,
    showMethod: 'slideDown',
    timeOut: 3000
};

function toInt(str){
    var f = parseInt(str);
    if (!f){
        f = 0;
    }
    return f;
}

function doane(event) {
    e = event ? event : window.event;
    if(!e) return;
    
    e.stopPropagation();
    e.preventDefault();

    e.returnValue = false;
    e.cancelBubble = true;
}

function loadShow() {
	layer.load();
}

function loadHide() {
	layer.closeAll('loading'); 
}

function tip(msg, em, pos) {
	
	var p = 2;
	if (pos == 'left'){
		p = 4;
	}else if(pos == 'top'){
		p = 1;
	}else if(pos == 'bottom'){
		p = 3;
	}

	layer.tips(msg, em, {
	  tips: p
	});
}

function showBox(url) {
	layer.open({
		type: 2,
		title: '',
		shadeClose: true,
		shade: 0.8,
		area: ['555px', '520px'],
		content: url
	}); 
}

var isInitConfirmBox = false;
function confirmDel(func){
    confirmBox('', func);
}

function confirmBox(msg, func){
    if(typeof msg == 'undefined' || msg == ''){
        msg = 'Are you sure you want to delete it?';
    }
    
    if(!isInitConfirmBox){
        var str = '<div class="modal fade" id="confirmBox" tabindex="-1" style="z-index:99999999" role="dialog" aria-hidden="true">';
        str += '<div class="modal-dialog modal-sm">';
        str += '            <div class="modal-content">';                 
        str += '              <div class="modal-body">';
        str +=  msg;
        str += '</div><div class="modal-footer">';
        str += '                <button type="button" class="btn btn-danger" id="confirmBoxOk" >确定</button>';
        str += '                <button type="button" class="btn btn-default" data-dismiss="modal">取消</button>';
        str += '              </div></div></div></div>';
        $('body').prepend(str);

        isInitConfirmBox = true;
    }
    
    $('#confirmBox').modal();

    $('#confirmBoxOk').unbind('click');
    $('#confirmBoxOk').bind('click', function(){
        if(typeof func == 'function'){
            func();
        }

        $('#confirmBox').modal('hide');

        return false;
    });
}
